import React from "react";
import "./Home.css";

function Home() {
  return (
    <div className="home">
      <div className="hero-section">
        <div className="bg"></div>
        <div className="hero-text">
          <h1>Enhancing Indian Health Care System</h1>
          <p>Your one-stop solution for all health care needs.</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
